import "./Services.css";
function Services(head, info) {
  return (
    <div className="services">
      <h2>Our Services</h2>
      <div className="services-container">
        <div className="service">
          <div className="service-icon">
            <i className="fas fa-laptop"></i>
          </div>
          <h3>{head}</h3>
          <p>{info}</p>
        </div>
      </div>
    </div>
  );
}
export default Services;
